import  React ,{useEffect} from 'react';
import { DataGrid } from '@material-ui/data-grid';

const columns = [
  { field: 'id', headerName: 'ID', width: 120 },
  {
    field: 'email ',
    headerName: 'Email',
    width: 300,
    editable: false,
  },
];





export default function Grid() {
  return (
    <div style={{ height: 400, width: '80%' }}>
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        checkboxSelection
        disableSelectionOnClick
      />
    </div>
  );
}
